import styled, { css } from 'styled-components';
import mole from "./../core/Mole";
import useClick from "../hooks/useClick";
import useMovePage from "../hooks/useMovePage";

const Container = styled.div`
    width: 100%;
    height: 100vh;
    background-color: #bdc3c7;
`;

const Button = styled.button`
    display: inline-flex;
    align-items: center;
    outline: none;
    border: none;
    border-radius: 4px;
    color: white;
    font-weight: bold;
    cursor: pointer;
    padding-left: 1rem;
    padding-right: 1rem;
    height: 10.25rem;
    font-size: 2rem;
    background: #228be6;
    &:hover{
        background: #339af0;
    }
    &:active{
        background: #1c7ed6;
    }
    & + & {
        margin-left: 1rem;
    }
`;

const Ready = () => {

    const [setPage] = useMovePage();

    return (
        <Container>
            <Button onClick={() => (setPage('game'))}>시작</Button>
        </Container>
    )
}

export default Ready;
